import React, { useEffect, useState } from 'react';
import { getModels } from '../services/api';

const Models = () => {
    const [models, setModels] = useState([]);

    useEffect(() => {
        getModels().then(response => {
            setModels(response.data);
        });
    }, []);

    return (
        <div>
            <h1>Models</h1>
            <table style={styles.table}>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Description</th>
                        <th>Category</th>
                        <th>Image</th>
                    </tr>
                </thead>
                <tbody>
                    {models.map(model => (
                        <tr key={model._id}>
                            <td>{model.name}</td>
                            <td>{model.description}</td>
                            <td>{model.category.name}</td>
                            <td>
                                {model.image && <img src={`http://localhost:5000/${model.image}`} alt={model.name} style={styles.image} />}
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

const styles = {
    table: {
        width: '100%',
        borderCollapse: 'collapse',
    },
    image: {
        width: '50px',
        height: '50px',
    },
    th: {
        borderBottom: '2px solid #ddd',
        padding: '8px',
    },
    td: {
        borderBottom: '1px solid #ddd',
        padding: '8px',
    },
};

export default Models;
